import React from "react";
import { Link } from "react-router-dom";
import { getDriverData } from "../../store/driverSlice";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";

export default function DriverScreen(){

    const drivers = useSelector((state)=>state.driver.totalDrivers)

    console.log("drivers variable::",drivers)
    

    const dispatch = useDispatch();

   useEffect(()=>{
       dispatch(getDriverData())
   },[dispatch]);

    return(
        <div>
            <h1>Displaying All Drivers</h1>
            <Link to="/admin/addDriver">Add Driver</Link>
        </div>
    )
}
